	private static class Pair {
		int x;
		int y;
		Pair(int x, int y) {
			this.x = x;
			this.y = y;
		}
		public String toString() {
			return String.format("[%d,%d]",x,y);
		}
	}
	public void solveBFS(char[][] board) {
		if ( board == null || board.length < 2 || board[0].length < 2 ) return;
        for ( int j = 0; j < board[0].length; j++ ) {
    		if ( board[0][j] == 'O' ) solveBFSHelper(board,new Pair(0,j));
    		if ( board[board.length-1][j] == 'O' ) solveBFSHelper(board,new Pair(board.length-1,j));
    	}
        for ( int i = 0; i < board.length; i++ ) {
        	if ( board[i][0] == 'O' ) solveBFSHelper(board,new Pair(i,0));
    		if ( board[i][board[i].length-1] == 'O' ) solveBFSHelper(board,new Pair(i,board[i].length-1));
        }
        for ( int i = 0; i < board.length; i++ ) {
        	for ( int j = 0; j < board[i].length; j++ ) {
        		if ( board[i][j] == '*' ) board[i][j] = 'O';
        		else if ( board[i][j] == 'O' ) board[i][j] = 'X';
        	}
        }
	}
	public void solveBFSQuick(char[][] board) {
		if ( board == null || board.length < 2 || board[0].length < 2 ) return;
		int count = 20;
        while ( count>0 && (solveHelper(board,1)||solveHelper(board,-1)) )
        	count--;
        System.out.println(count);
        if ( count == 0 ) {
        	for ( int i = 1; i < board.length-1; i++ ) {
            	for ( int j = 1; j < board[i].length-1; j++ ) {
            		if ( board[i][j]=='O' && (
            				board[i-1][j]=='*' || board[i+1][j]=='*' || board[i][j-1]=='*' || board[i][j+1]=='*'
            				) )
            			solveBFSHelper(board,new Pair(i,j));
            	}
        	}
        }
		for ( int i = 0; i < board.length; i++ ) {
        	for ( int j = 0; j < board[i].length; j++ ) {
        		if ( board[i][j] == '*' ) board[i][j] = 'O';
        		else if ( board[i][j] == 'O' ) board[i][j] = 'X';
        	}
        }
	}
	private void solveBFSHelper(char[][] board, Pair root) {
		Queue<Pair> queue = new LinkedList<Pair>();
		board[root.x][root.y] = '*';
		queue.add(root);
		while ( !queue.isEmpty() ) {
			Pair cell = queue.remove();
			int i = cell.x, j = cell.y;
			if ( i > 0 && board[i-1][j] == 'O' ) {
				board[i-1][j]='*';
				queue.add(new Pair(i-1,j));
			}
			if ( j > 0 && board[i][j-1] == 'O' ) {
				board[i][j-1]='*';
				queue.add(new Pair(i,j-1));
			}
			if ( i < board.length-1 && board[i+1][j] == 'O' ) {
				board[i+1][j]='*';
				queue.add(new Pair(i+1,j));
			}
			if ( j < board[i].length-1 && board[i][j+1] == 'O' ) {
				board[i][j+1]='*';
				queue.add(new Pair(i,j+1));
			}
		}
	}
	public void solve(char[][] board) {
        if ( board == null || board.length < 2 || board[0].length < 2 ) return;
        int count = 0;
        while ( solveHelper(board,1)||solveHelper(board,-1) )
        	count ++;
        for ( int i = 0; i < board.length; i++ ) {
        	for ( int j = 0; j < board[i].length; j++ ) {
        		if ( board[i][j] == '*' ) board[i][j] = 'O';
        		else if ( board[i][j] == 'O' ) board[i][j] = 'X';
        	}
        }
        System.out.println(count);
    }
	private boolean solveHelper(char[][] board, int offset) {
		boolean isChanged = false;
		for ( int j = 0, line = offset==1?0:board.length-1; j < board[0].length; j++ ) {
        	if ( board[line][j] == 'O' ) {board[line][j]='*';isChanged=true;}
        }
        for ( int i = offset==1?1:board.length-2; i >= 0 && i < board.length; i+=offset ) {
        	int js = 0, j = 0;
        	boolean isLinked = true;
        	int len = board[i].length;
        	while ( j < len ) {
        		while ( j < len && board[i][j] == 'O' ) {
        			if ( !isLinked && (j==len-1||board[i-offset][j]=='*') ) isLinked = true;
        			j++;
        		}
        		if ( isLinked ) {
        			while ( js < j ) {
        				board[i][js++]='*';
        				isChanged=true;
        			}
        		}
        		isLinked = false;
        		while ( j < len && board[i][j] != 'O' ) {
        			j++;
        		}
        		js = j;
        	}
        }
        return isChanged;
	}
